(this["webpackJsonpbrown-edu-orchestra"]=this["webpackJsonpbrown-edu-orchestra"]||[]).push([[5],{76:function(e,t,r){"use strict";r.r(t),r.d(t,"readingTime",(function(){return a})),r.d(t,"meta",(function(){return i})),r.d(t,"default",(function(){return h})),r.d(t,"tableOfContents",(function(){return c})),r.d(t,"frontMatter",(function(){return d}));var n=r(11),o=(r(2),r(1)),a={text:"3 min read",minutes:2.445,time:146700,words:489},i={title:"A Letter from the 2019-2020 President",subtitle:"Looking forward to new heights",author:{name:"Rainbow Chen",uid:"rainbowchen1",email:"rainbow_chen@brown.edu",browndirectory:"741b9f24-a5e4-43e4-b412-0249a96b9709"},topic:"Announcements",date:"2019-06-22",image:{url:"/images/2020-12/rainbow_michael.jpg",caption:"Michael Tu, Board Vice President (left) and Rainbow Chen, Board President (right) pose for a photo before rehearsal.",attr:"Xinru Li/Brown University Orchestra"},path:"/news/2019-06-22/president-welcome"},s={meta:i};function h(e){var t=e.components,r=Object(n.a)(e,["components"]);return Object(o.a)("wrapper",Object.assign({},s,r,{components:t,mdxType:"MDXLayout"}),Object(o.a)("p",null,"Hello all! My name is Rainbow Chen and I am the President of the Brown University Orchestra for the 2019\u20132020 school year! I am a double bassist concentrating in Education Policy and History and I am extremely honored and delighted to lead the orchestra board and represent the orchestra this year. I hope that myself and my Vice President Michael Tu \u201822 can continue the wonderful work that our former President and Vice President Lucy Duda \u201820 and Max Naftol \u201819 have done to help give our orchestra members an unforgettable orchestral experience."),Object(o.a)("p",null,"The past few years have been a time of exciting change for the Brown University Orchestra and this year is no different! The 2018\u20132019 school year \u201cmark\u201ded the end of our first year with Mark Seto, our new director of the orchestra, and we\u2019re pleased to say that it\u2019s been a wonderful first year!"),Object(o.a)("p",null,"At around 90 members (with about a record 40 first-years!), the Brown University Orchestra performed a variety of pieces ranging from classics like Mahler Symphony no. 1 and Saint-Saens Symphony no. 3 \u201cOrgan\u201d featuring Brown University Organist Mark Steinbach, a memorial event for tubist Anthony Brattoli featuring former conductor Paul Phillips, to solo work with artist-in-residence Kinan Azmeh\u2019s Clarinet Concerto (which was just premiered with the Seattle Symphony right before own performance) and Tchaikovsky\u2019s Violin Concerto featuring Concerto Competition Winner Typher Yom \u201819."),Object(o.a)("p",null,"Aside from performing incredible pieces in our favorite Sayles Hall, we\u2019ve had many opportunities during rehearsal to bond and get to know each other. We\u2019ve had multiple pizza socials, board game nights, movie nights, Valentine\u2019s Day Speed-\u201dFriending\u201d, and hanging out outside of rehearsal!"),Object(o.a)("p",null,"We\u2019ve had so much fun over the past year, but as we neared the end of our season, we had to say farewell to our graduating senior class. This year, we said goodbye to 5 violinists, 3 violists, 3 cellists, 2 bassists, an oboist, a bassoonist, a trumpet player, a horn player, and a percussionist (a whopping 18 seniors!!), many of which have stayed in the orchestra for all 4 years of their time at Brown! BUT! When one door closes, another door opens and we\u2019re extremely excited for what\u2019s in store for the upcoming year."),Object(o.a)("p",null,"With the continuing construction of Brown\u2019s first official Performing Arts Center, over 50 incoming first-years signing up to potentially join the orchestra, and an incredible orchestra program in the 2019\u20132020 school year, this upcoming year will be a BLAST! To stay connected and updated on what we\u2019re up to, please follow us on social media and look out for an upcoming Brown Orchestra newsletter! We can\u2019t wait to show what we\u2019re doing this year!"),Object(o.a)("p",null,"Yours truly,\nRainbow Chen \u201821\nPresident of the Brown University Orchestra"))}h.isMDXComponent=!0;var c=function(){return[]},d={}}}]);
